import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'

class Index extends React.Component {
  render() {
    return (
      <fragment>
        <div>Hello</div>
      </fragment>
    )
  }
}

// ========================================

ReactDOM.render(<Index />, document.getElementById('root'))
